import { motion } from 'framer-motion';
import '../styles/movingObjectStyles.css';

const Elevator = ({ y, style, handleElevetorArrived }) => {
  return (
    <motion.div
      className="moving-object"
      style={{
        ...style,
        y: y,
      }}
      animate={{
        y: y,
        transition: {
          duration: 7,
        },
      }}
      onTransitionEnd={handleElevetorArrived}
    />
  );
};

export default Elevator;
